import React, { Component } from 'react';
import Nav from './Nav';
import Section from './Section';
import Footer from './Footer';
import './App.css';
import './bootstrap.css'

class App extends Component {
  render() {
    return (
      <div>
        <Nav />
        <body className="container-fluid">
          <Section />
        </body>
        <footer>
          <Footer />
        </footer>
      </div>


    );
  }
}

export default App;
